import React from 'react';
import {
    Timeline,
    Events,
    UrlButton,
    ImageEvent,
    TextEvent,
    YouTubeEvent,
  } from '@merc/react-timeline';

class Resume extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div className='page'>
                <h1 className='header typeWriter'>Resume</h1>
                <Timeline>
                    <Events>
                    <TextEvent date="Oct 2021" text="**DevOps Engineer - National Australia Bank (NAB)** <br>" />
                    <TextEvent date="Feb 2019" text="**Integration Engineer - Ericsson**
                     Delivered infrastructure projects for the National Broadbank Network (NBN) Fixed Wireless Network serving 600,000+ subscribers." />
                    </Events>
                </Timeline>
            </div>
        )
    }
    
}


export default Resume;
